    // ‡∏à‡∏≥‡∏ô‡∏ß‡∏ô‡∏ó‡∏µ‡πà‡∏à‡∏∞‡∏™‡∏∏‡πà‡∏°
    const mode = globalState.lucky.mode;
    let showCount = 1;
    if (mode === '2') showCount = 2;
