    btn.innerHTML = '<i class="fa-solid fa-rotate-right mr-2"></i> ‡∏™‡∏∏‡πà‡∏°‡∏≠‡∏µ‡∏Å‡∏Ñ‡∏£‡∏±‡πâ‡∏á';
    btn.classList.replace('from-red-600', 'from-pink-600');
