// ‡πÉ‡∏ô‡πÑ‡∏ü‡∏•‡πå js/ui-render.js

export function openEditTaskModal(taskId) {
    const task = dataState.tasks.find(t => String(t.id) === String(taskId));
    if (!task) return;

    // ‡πÄ‡∏õ‡∏¥‡∏î Modal
    const modal = document.getElementById('edit-column-modal');
    modal.classList.remove('hidden');

    // ‡∏ï‡∏±‡πâ‡∏á‡∏Ñ‡πà‡∏≤‡πÇ‡∏´‡∏°‡∏î
    document.getElementById('edit-mode').value = 'task_accum'; 
    document.getElementById('edit-col-id').value = task.id;
    
    // ‡πÉ‡∏™‡πà‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡πÄ‡∏î‡∏¥‡∏°
    document.getElementById('edit-col-name').value = task.name;
    document.getElementById('edit-col-max').value = task.maxScore;

    // ‡πÄ‡∏ï‡∏£‡∏µ‡∏¢‡∏°‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡∏ö‡∏ó
    const cls = dataState.classes.find(c => c.id == task.classId);
    const subject = cls ? dataState.subjects.find(s => s.id == cls.subjectId) : null;
    const chapNames = subject ? (subject.chapterNames || []) : [];

    // ‡πÅ‡∏õ‡∏•‡∏á‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏• chapter ‡∏Ç‡∏≠‡∏á‡∏á‡∏≤‡∏ô‡πÉ‡∏´‡πâ‡πÄ‡∏õ‡πá‡∏ô Array
    let currentChapters = [];
    if (Array.isArray(task.chapter)) {
        currentChapters = task.chapter.map(String);
    } else if (task.chapter != null && task.chapter !== '') {
        currentChapters = [String(task.chapter)];
    }

    // ‚≠ê ‡∏à‡∏∏‡∏î‡πÄ‡∏õ‡∏•‡∏µ‡πà‡∏¢‡∏ô: ‡∏™‡∏£‡πâ‡∏≤‡∏á Checkbox List ‡πÅ‡∏ó‡∏ô Select
    const container = document.getElementById('edit-col-category').parentNode; // ‡∏´‡∏≤ div ‡∏û‡πà‡∏≠‡∏Ç‡∏≠‡∏á select ‡πÄ‡∏î‡∏¥‡∏°
    
    // ‡∏•‡∏ö Select ‡πÄ‡∏î‡∏¥‡∏°‡∏ó‡∏¥‡πâ‡∏á (‡∏ñ‡πâ‡∏≤‡∏°‡∏µ) ‡∏´‡∏£‡∏∑‡∏≠‡∏ã‡πà‡∏≠‡∏ô‡πÑ‡∏ß‡πâ
    const oldSelect = document.getElementById('edit-col-category');
    if(oldSelect) oldSelect.classList.add('hidden'); // ‡∏ã‡πà‡∏≠‡∏ô Select ‡πÄ‡∏î‡∏¥‡∏°

    // ‡∏™‡∏£‡πâ‡∏≤‡∏á‡∏û‡∏∑‡πâ‡∏ô‡∏ó‡∏µ‡πà Checkbox ‡πÉ‡∏´‡∏°‡πà (‡∏ñ‡πâ‡∏≤‡∏¢‡∏±‡∏á‡πÑ‡∏°‡πà‡∏°‡∏µ)
    let checkboxContainer = document.getElementById('chapter-checkbox-list');
    if (!checkboxContainer) {
        checkboxContainer = document.createElement('div');
        checkboxContainer.id = 'chapter-checkbox-list';
        checkboxContainer.className = "grid grid-cols-2 gap-2 max-h-40 overflow-y-auto bg-black/20 p-2 rounded-xl mt-2 custom-scrollbar";
        container.appendChild(checkboxContainer);
    }
    checkboxContainer.innerHTML = ''; // ‡∏•‡πâ‡∏≤‡∏á‡∏Ç‡∏≠‡∏á‡πÄ‡∏Å‡πà‡∏≤
    checkboxContainer.classList.remove('hidden');

    // ‡∏™‡∏£‡πâ‡∏≤‡∏á Checkbox 1-20 ‡∏ö‡∏ó
    for(let i=1; i<=20; i++) {
        const name = chapNames[i-1] ? ` (${chapNames[i-1]})` : '';
        const isChecked = currentChapters.includes(String(i)) ? 'checked' : '';
        
        // Highlight ‡∏ö‡∏ó‡∏ó‡∏µ‡πà‡∏ñ‡∏π‡∏Å‡πÄ‡∏•‡∏∑‡∏≠‡∏Å
        const bgClass = isChecked ? 'bg-blue-600/30 border-blue-500' : 'bg-white/5 border-transparent';
        
        checkboxContainer.innerHTML += `
            <label class="flex items-center gap-2 p-2 rounded border ${bgClass} hover:bg-white/10 cursor-pointer transition-colors text-xs text-white">
                <input type="checkbox" class="accent-blue-500 w-4 h-4 chapter-selector" value="${i}" ${isChecked}>
                <span class="truncate">‡∏ö‡∏ó‡∏ó‡∏µ‡πà ${i}${name}</span>
            </label>
        `;
    }
    
    // ‡πÄ‡∏õ‡∏•‡∏µ‡πà‡∏¢‡∏ô Label ‡πÉ‡∏´‡πâ‡πÄ‡∏Ç‡πâ‡∏≤‡πÉ‡∏à‡∏á‡πà‡∏≤‡∏¢
    const label = container.querySelector('label');
    if(label) label.textContent = "‡πÄ‡∏•‡∏∑‡∏≠‡∏Å‡∏ö‡∏ó‡πÄ‡∏£‡∏µ‡∏¢‡∏ô‡∏ó‡∏µ‡πà‡πÄ‡∏Å‡∏µ‡πà‡∏¢‡∏ß‡∏Ç‡πâ‡∏≠‡∏á (‡πÄ‡∏•‡∏∑‡∏≠‡∏Å‡πÑ‡∏î‡πâ‡∏´‡∏•‡∏≤‡∏¢‡∏ö‡∏ó)";
    
    document.getElementById('edit-col-desc').classList.add('hidden');
}
// ‡∏ü‡∏±‡∏á‡∏Å‡πå‡∏ä‡∏±‡∏ô‡πÄ‡∏õ‡∏¥‡∏î Modal ‡∏á‡∏≤‡∏ô‡∏Ç‡∏≠‡∏á‡∏ô‡∏±‡∏Å‡πÄ‡∏£‡∏µ‡∏¢‡∏ô (Student Side)
export function openStudentTaskModal(taskId, studentId) {
    const task = dataState.tasks.find(t => String(t.id) === String(taskId));
    const student = dataState.students.find(s => String(s.id) === String(studentId));
    
    if (!task || !student) return;

    const modal = document.getElementById('student-task-modal');
    modal.classList.remove('hidden');

    // 1. ‡πÉ‡∏™‡πà‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡∏á‡∏≤‡∏ô
    document.getElementById('st-modal-title').textContent = task.name;
    document.getElementById('st-modal-desc').textContent = `‡∏Ñ‡∏∞‡πÅ‡∏ô‡∏ô‡πÄ‡∏ï‡πá‡∏°: ${task.maxScore}`;
    document.getElementById('st-modal-date').textContent = task.dueDate ? formatThaiDate(task.dueDate) : '‡πÑ‡∏°‡πà‡∏°‡∏µ‡∏Å‡∏≥‡∏´‡∏ô‡∏î';
    
    // üü¢ ‡∏™‡πà‡∏ß‡∏ô‡∏ó‡∏µ‡πà‡πÄ‡∏û‡∏¥‡πà‡∏°: ‡πÅ‡∏™‡∏î‡∏á‡∏£‡∏≤‡∏¢‡∏•‡∏∞‡πÄ‡∏≠‡∏µ‡∏¢‡∏î‡πÅ‡∏•‡∏∞‡∏£‡∏π‡∏õ‡∏†‡∏≤‡∏û‡∏Ç‡∏≠‡∏á‡∏á‡∏≤‡∏ô (‡πÅ‡∏ó‡∏£‡∏Å‡∏´‡∏•‡∏±‡∏á‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡∏´‡∏•‡∏±‡∏Å)
    let extraInfoHtml = '';
    if (task.description) {
        extraInfoHtml += `
            <div class="bg-blue-900/30 p-3 rounded-lg border border-blue-500/40 mt-3 mb-2 shadow-inner">
                <p class="text-sm text-blue-100 whitespace-pre-line"><i class="fa-solid fa-circle-info mr-1 text-blue-300"></i> ${task.description}</p>
            </div>`;
    }
    if (task.image) {
        extraInfoHtml += `
            <div class="mt-2 mb-4 text-center">
                <img src="${task.image}" class="max-w-full h-auto max-h-48 mx-auto rounded-xl border border-white/20 shadow-lg object-contain bg-black/50 p-1">
            </div>`;
    }
    
    // ‡∏´‡∏≤ Element ‡∏´‡∏£‡∏∑‡∏≠‡∏™‡∏£‡πâ‡∏≤‡∏á‡πÉ‡∏´‡∏°‡πà‡πÄ‡∏û‡∏∑‡πà‡∏≠‡πÉ‡∏™‡πà‡∏£‡∏≤‡∏¢‡∏•‡∏∞‡πÄ‡∏≠‡∏µ‡∏¢‡∏î‡∏á‡∏≤‡∏ô
    let extraContainer = document.getElementById('st-modal-extra-info');
    if (!extraContainer) {
        // ‡∏ñ‡πâ‡∏≤‡∏¢‡∏±‡∏á‡πÑ‡∏°‡πà‡∏°‡∏µ‡∏Ñ‡∏≠‡∏ô‡πÄ‡∏ó‡∏ô‡πÄ‡∏ô‡∏≠‡∏£‡πå‡∏ô‡∏µ‡πâ ‡πÉ‡∏´‡πâ‡∏™‡∏£‡πâ‡∏≤‡∏á‡πÅ‡∏•‡∏∞‡πÅ‡∏ó‡∏£‡∏Å‡∏ï‡πà‡∏≠‡∏à‡∏≤‡∏Å st-modal-desc
        const targetEl = document.getElementById('st-modal-desc');
        extraContainer = document.createElement('div');
        extraContainer.id = 'st-modal-extra-info';
        // ‡πÅ‡∏ó‡∏£‡∏Å‡πÄ‡∏Ç‡πâ‡∏≤‡πÑ‡∏õ‡∏´‡∏•‡∏±‡∏á targetEl
        targetEl.parentNode.insertBefore(extraContainer, targetEl.nextSibling);
    }
    extraContainer.innerHTML = extraInfoHtml;
    // -------------------------------------------------------------

    // Hidden Input
    document.getElementById('st-modal-task-id').value = taskId;
    document.getElementById('st-modal-student-id').value = studentId;

    // 2. ‡∏î‡∏∂‡∏á‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡∏Å‡∏≤‡∏£‡∏™‡πà‡∏á‡∏á‡∏≤‡∏ô‡πÄ‡∏î‡∏¥‡∏° (‡∏ñ‡πâ‡∏≤‡∏°‡∏µ)
    const scoreObj = dataState.scores.find(s => s.studentId == studentId && s.taskId == taskId);
    const subInput = document.getElementById('st-modal-submission');
    const feedbackArea = document.getElementById('st-modal-feedback-area');
    const submitBtn = document.getElementById('st-modal-submit-btn');

    if (scoreObj) {
        subInput.value = scoreObj.submission || '';
        
        // ‡∏ñ‡πâ‡∏≤‡∏Ñ‡∏£‡∏π‡∏ï‡∏£‡∏ß‡∏à‡πÅ‡∏•‡πâ‡∏ß
        if (scoreObj.score !== null && scoreObj.score !== undefined) {
            feedbackArea.classList.remove('hidden');
            document.getElementById('st-modal-score').textContent = `${scoreObj.score}/${task.maxScore}`;
            document.getElementById('st-modal-comment').innerHTML = scoreObj.comment ? `"${scoreObj.comment}"` : '- ‡πÑ‡∏°‡πà‡∏°‡∏µ‡∏Ç‡πâ‡∏≠‡∏Ñ‡∏ß‡∏≤‡∏° -';
            
            // ‡∏õ‡∏¥‡∏î‡∏Å‡∏≤‡∏£‡πÅ‡∏Å‡πâ‡πÑ‡∏Ç‡∏ñ‡πâ‡∏≤‡∏ï‡∏£‡∏ß‡∏à‡πÅ‡∏•‡πâ‡∏ß (Optional)
            // subInput.disabled = true;
            // submitBtn.classList.add('hidden');
        } else {
            feedbackArea.classList.add('hidden');
            // subInput.disabled = false;
            // submitBtn.classList.remove('hidden');
        }
    } else {
        subInput.value = '';
        feedbackArea.classList.add('hidden');
    }

    // üü¢ 3. ‡πÇ‡∏´‡∏•‡∏î‡∏£‡∏≤‡∏¢‡∏ä‡∏∑‡πà‡∏≠‡πÄ‡∏û‡∏∑‡πà‡∏≠‡∏ô (Friend Selector)
    const friendList = document.getElementById('st-friend-list');
    const friendSearch = document.getElementById('st-friend-search');
    
    if (friendList) {
        friendList.innerHTML = ''; // ‡πÄ‡∏Ñ‡∏•‡∏µ‡∏¢‡∏£‡πå‡πÄ‡∏Å‡πà‡∏≤
        if (friendSearch) friendSearch.value = ''; // ‡πÄ‡∏Ñ‡∏•‡∏µ‡∏¢‡∏£‡πå‡∏Ñ‡πâ‡∏ô‡∏´‡∏≤

        // ‡∏î‡∏∂‡∏á‡πÄ‡∏û‡∏∑‡πà‡∏≠‡∏ô‡πÉ‡∏ô‡∏´‡πâ‡∏≠‡∏á‡πÄ‡∏î‡∏µ‡∏¢‡∏ß‡∏Å‡∏±‡∏ô (‡πÑ‡∏°‡πà‡∏£‡∏ß‡∏°‡∏ï‡∏±‡∏ß‡πÄ‡∏≠‡∏á)
        const friends = dataState.students
            .filter(s => s.classId == student.classId && s.id != studentId)
            .sort((a, b) => Number(a.no) - Number(b.no));

        friends.forEach(f => {
            const div = document.createElement('div');
            div.className = "st-friend-item flex items-center gap-2 p-2 bg-white/5 rounded hover:bg-white/10 cursor-pointer border border-white/5";
            div.innerHTML = `
                <input type="checkbox" value="${f.id}" class="st-friend-checkbox accent-green-500 w-4 h-4">
                <span class="text-xs text-white/80">‡πÄ‡∏•‡∏Ç‡∏ó‡∏µ‡πà ${f.no} ${f.name}</span>
            `;
            friendList.appendChild(div);
        });

        // Event ‡∏Ñ‡πâ‡∏ô‡∏´‡∏≤‡πÄ‡∏û‡∏∑‡πà‡∏≠‡∏ô
        if (friendSearch) {
            friendSearch.onkeyup = (e) => {
                const term = e.target.value.toLowerCase();
                document.querySelectorAll('.st-friend-item').forEach(item => {
                    item.style.display = item.textContent.toLowerCase().includes(term) ? 'flex' : 'none';
                });
            };
        }
    }
}
