        const subj = cls ? dataState.subjects.find(s => s.id == cls.subjectId) : null;
        const subjName = subj ? subj.name : '‡πÑ‡∏°‡πà‡∏£‡∏∞‡∏ö‡∏∏‡∏ß‡∏¥‡∏ä‡∏≤';

        targetEl.classList.remove('hidden');
