    // 1. ‡∏´‡∏≤‡∏ó‡∏∏‡∏Å‡∏´‡πâ‡∏≠‡∏á‡∏ó‡∏µ‡πà‡πÄ‡∏£‡∏µ‡∏¢‡∏ô‡∏ß‡∏¥‡∏ä‡∏≤‡∏ô‡∏µ‡πâ
    const classes = dataState.classes.filter(c => c.subjectId == subjectId);
    const classIds = classes.map(c => c.id);

    // 2. ‡∏´‡∏≤‡∏á‡∏≤‡∏ô‡∏ó‡∏±‡πâ‡∏á‡∏´‡∏°‡∏î‡∏Ç‡∏≠‡∏á‡∏´‡πâ‡∏≠‡∏á‡πÄ‡∏´‡∏•‡πà‡∏≤‡∏ô‡∏µ‡πâ
    const tasks = dataState.tasks.filter(t => classIds.includes(t.classId));

