// ‡∏ü‡∏±‡∏á‡∏Å‡πå‡∏ä‡∏±‡∏ô‡πÄ‡∏õ‡∏¥‡∏î Modal ‡∏™‡∏£‡πâ‡∏≤‡∏á‡∏Ç‡πâ‡∏≠‡∏™‡∏≠‡∏ö
window.openExamModal = function(examId = null) {
    const modal = document.getElementById('exam-editor-modal');
    
    // ‡∏ñ‡πâ‡∏≤‡∏´‡∏≤ HTML ‡πÑ‡∏°‡πà‡πÄ‡∏à‡∏≠ ‡πÉ‡∏´‡πâ‡πÅ‡∏à‡πâ‡∏á‡πÄ‡∏ï‡∏∑‡∏≠‡∏ô (‡∏à‡∏∞‡πÑ‡∏î‡πâ‡∏£‡∏π‡πâ‡∏ß‡πà‡∏≤‡∏•‡∏∑‡∏°‡∏Ç‡∏±‡πâ‡∏ô‡∏ï‡∏≠‡∏ô‡∏ó‡∏µ‡πà 1)
    if (!modal) {
        alert("Error: ‡πÑ‡∏°‡πà‡∏û‡∏ö HTML Modal (exam-editor-modal) ‡πÉ‡∏ô‡∏´‡∏ô‡πâ‡∏≤ index.html");
        return;
    }

    const form = document.getElementById('exam-form');
    const container = document.getElementById('questions-container');
    
    // Reset ‡∏Ñ‡πà‡∏≤‡πÄ‡∏î‡∏¥‡∏°
    if(form) form.reset();
    if(container) container.innerHTML = ''; 
    document.getElementById('exam-id').value = '';
    
    // ‡πÄ‡∏ï‡∏¥‡∏°‡∏ß‡∏¥‡∏ä‡∏≤‡∏•‡∏á‡πÉ‡∏ô Dropdown
    const subjSelect = document.getElementById('exam-subject');
    if (subjSelect) {
        subjSelect.innerHTML = '<option value="">-- ‡πÄ‡∏•‡∏∑‡∏≠‡∏Å‡∏ß‡∏¥‡∏ä‡∏≤ --</option>' + 
            dataState.subjects.map(s => `<option value="${s.id}">${s.name}</option>`).join('');
    }

    // ‡∏Å‡∏£‡∏ì‡∏µ‡πÅ‡∏Å‡πâ‡πÑ‡∏Ç (Edit)
    if(examId) {
        const exam = dataState.exams.find(e => e.id === examId);
        if(exam) {
            document.getElementById('exam-id').value = exam.id;
            document.getElementById('exam-title').value = exam.title;
            document.getElementById('exam-subject').value = exam.subjectId;
            document.getElementById('exam-duration').value = exam.timeLimit;
            document.getElementById('exam-max-switch').value = exam.allowSwitch;
            document.getElementById('exam-password').value = exam.password;
            document.getElementById('exam-shuffle-q').checked = exam.shuffleQuestions;
            document.getElementById('exam-shuffle-c').checked = exam.shuffleChoices;
            
            // Render ‡∏Ñ‡∏≥‡∏ñ‡∏≤‡∏°‡πÄ‡∏î‡∏¥‡∏°
            if(exam.questions) exam.questions.forEach(q => addQuestionItem(q));
        }
    } else {
        // ‡∏Å‡∏£‡∏ì‡∏µ‡∏™‡∏£‡πâ‡∏≤‡∏á‡πÉ‡∏´‡∏°‡πà (‡πÄ‡∏û‡∏¥‡πà‡∏°‡∏Ç‡πâ‡∏≠‡πÄ‡∏õ‡∏•‡πà‡∏≤‡πÜ ‡πÉ‡∏´‡πâ 1 ‡∏Ç‡πâ‡∏≠)
        addQuestionItem(); 
    }

    modal.classList.remove('hidden');
}

// ‡∏ü‡∏±‡∏á‡∏Å‡πå‡∏ä‡∏±‡∏ô‡∏õ‡∏¥‡∏î Modal
window.closeExamModal = function() {
    const modal = document.getElementById('exam-editor-modal');
    if(modal) modal.classList.add('hidden');
}

