    const container = document.getElementById('exam-content-area'); 
    
    const btnScore = document.getElementById('btn-mode-score');
    const btnOnline = document.getElementById('btn-mode-online');

    // ‡∏õ‡πâ‡∏≠‡∏á‡∏Å‡∏±‡∏ô Error ‡∏Å‡∏£‡∏ì‡∏µ‡∏´‡∏≤‡∏õ‡∏∏‡πà‡∏°‡πÑ‡∏°‡πà‡πÄ‡∏à‡∏≠
    if (!container || !btnScore || !btnOnline) return;

